// NOTE: there have to be V_RES lines, but (about) V_SP of those are taken care of by the gab between the SPI data and the next frame as determined by the interrupt that starts a new frame.
#define LINES (V_LINES - V_SP)

// the 8 bits of the parallel SPI output represent 2*red, 3*green, 2*blue, and the horizontal sync
// Therefore: TX_FRAME_BYTES should now be H_PIX * 8 bits, each byte is 32 bits wide: H_PIX * 8 / 32 = H_PIX/4 = H_PIX>>2 bytes.
#define TX_FRAME_BYTES (H_PIX >> 2)

